The SPARQL query to retrieve this information from DBpedia would involve querying the relationships between these individuals and their roles. Here's how we can structure the query:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>

SELECT ?parent WHERE {
  ?thihapate a dbpedia-owl:Viceroy ;
               dbpedia-owl:hasParent ?parent .
  ?parent a dbpedia-owl:OfficeHolder;
          rdfs:label [ substring(???) "royalty" ] .
}

# Assuming Thihapate's parent is known to be Min Hlaing (Thaung Tweti)
PREFIX dbo: <http://dbpedia.org/ontology/>

CONSTRUCT {
  ?parent dbpedia:hasChild ?child_of_thado_minsaw .
  ?child_of_thado_minsaw a dbo:Person;
                    rdfs:label "Thado Minsaw of Prome" .
} WHERE {
  ?thihapate dbpedia:Aungzeya; # Thihapate's ID in DBpedia
  ?parent dbo:hasParent ?thihapate .
  ?child_of_thado_minsaw dbo:hasParent ?parent .
}
```

This query will help us identify the parent of Thihapate and then filter for those who are both office holders and royalty. Once we have that information, we can determine Thihapate's predecessor based on historical records.

