The SPARQL query will involve looking up the person's name associated with both roles (actor in "Return to Nuke 'Em High Volume 1" and band member of "Nevermore") and then extracting their musical artist information. Here is a sample SPARQL query:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>

SELECT ?artist
WHERE {
  ?person a dbpedia-owl:Actor ;
            dbpedia-owl:roleFilm "Return to Nuke 'Em High Volume 1" .
  ?person a dbpedia-owl:BandMemberOf ; 
            dbpedia-owl:bandName "Nevermore" .
  ?person rdf:type dbpedia:Person .
  ?person rdfs:label ?name .
  OPTIONAL { ?person dbpedia:musicalArtist ?artist }
}
```

